// ==UserScript==
// @name         Bunkersoy
// @namespace    http://4chan.org
// @version      1.4
// @description  Paste a post into a crying soyjak image
// @author       (You)
// @include      https://bunkerchan.xyz/*/res/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    const options = {
        "Soyjack": 'data:image/jpeg;base64, ',
        "Soyjack2": 'data:image/png;base64, ',
        "Soyjack3": 'data:image/jpeg;base64,',
        "Soyjack4": 'data:image/png;base64, ',
        "Soyjack5": 'data:image/jpeg;base64, ',
        "Soyjack6": 'data:image/jpeg;base64, ',
        "Soyjack7": 'data:image/png;base64, ',
        "Soyjack8": 'data:image/png;base64, ',
        "PointingFingers": 'data:image/png;base64, ',
        "Pink": 'data:image/png;base64, ',
        "Doomer": 'data:image/jpeg;base64, ',
        "Marx": 'data:image/jpeg;base64, ',
        "Jannie": 'data:image/png;base64, ',
        "4cuck": 'data:image/png;base64, ',
        "Plebbit": 'data:image/jpeg;base64, ',
        "BasedPepe": 'data:image/jpeg;base64, ',
        "Pajeet": 'data:image/png;base64, ',
        "Lincuck": 'data:image/png;base64, ',
        "Soymer": 'data:image/png;base64, ',
        "Pseud": 'data:image/jpeg;base64, ',
        "Fed": 'data:image/png;base64, ',
        "NPCBrainlet": 'data:image/jpeg;base64, ',
        "SoyNPC": 'data:image/png;base64, ',
        "Hitler": 'data:image/jpeg;base64, ',
        "Jew": 'data:image/jpeg;base64, ',
        "Brainlet": 'data:image/jpeg;base64, ',
        "Brainlet2": 'data:image/jpeg;base64, ',
    }
    const quoteGreenColor = '#789922';
    const quoteOrangeColor = '#FF8C00';
    const bgColor = '#ffffff';
    //const bgColor = '#eef2ff';
    const fontSize = 48;
    const fontName = 'arial';
    const cutOffWord = (context, word, maxWidth) => {
        if(context.measureText(word).width > maxWidth) {
            let ret = "";
            for(let c of word) {
                let testWord = ret + c;
                if(context.measureText(testWord + "...").width > maxWidth) {
                    break;
                }
                ret = testWord;
            }

            return ret + "...";
        }
        return word;
    }

    const wrapText = (context, lines, maxWidth) => {
        let ret = [];
        for(const line of lines) {
            if(context.measureText(line).width > maxWidth) {
                ret.push(line.trim().split(" ").map(w => cutOffWord(context, w, maxWidth)).reduce((wrapedLine, word) => {
                    let testLine = wrapedLine + ' ' + word;
                    if(context.measureText(testLine).width > maxWidth) {
                        ret.push(wrapedLine);
                        return word;
                    }
                    return testLine;
                }));
            } else {
                ret.push(line);
            }
        }
        return ret;
    }

    const writeToCanvas = (context, lines, x, y, textHeight) => {
        for (const line of lines) {
            if(line.startsWith(">")) {
                context.fillStyle = quoteGreenColor;
            } else if(line.startsWith("<")) {
                context.fillStyle = quoteOrangeColor;
            }
            context.fillText(line, x, y);
            y += textHeight;
        }
    }

    const openInNewTab = (base64Data) => {
        let win = window.open();
        win.document.write('<iframe src="' + base64Data + '" frameborder="0" style="border:0; top:0px; left:0px; bottom:0px; right:0px; width:100%; height:100%;" allowfullscreen></iframe>');
    }

    const generateWojak = (postText) => {
        const image = new Image();
        const soyType = document.getElementById("soyjakSelector").value;
        image.src = options[soyType];

        const canvas = document.createElement('canvas');
        return new Promise((resolve) => {
            image.onload = function() {
                canvas.width = this.width;
                canvas.height = this.height + 100;
                const ctx = canvas.getContext('2d');
                const font = fontSize + 'px ' + fontName;

                ctx.font = font;
                const lines = wrapText(ctx, postText, this.width);
                canvas.height += lines.length * fontSize;

                ctx.fillStyle = bgColor;
                ctx.fillRect(0, 0, canvas.width, canvas.height);
                ctx.font = font;
                writeToCanvas(ctx, lines, 0, this.height + 100, fontSize);

                ctx.imageSmoothingEnabled = false;
                ctx.drawImage(this, 0, 0);
                canvas.toBlob((blob) => {
                    resolve(new File([blob], "(you).png", {type: "image/png"}));
                });
            };
        });
    }

    const memeficate = (array, seetheMode) => {
        let firstTextNode = true;
        return array.map(e => {
            if(e.startsWith(">") || e.startsWith("http://") || e.startsWith("https://")) {
                return ">" + e;
            } else if(e.startsWith("<")) {
                return "<" + e;
            } else {
                const ret = ">" + (firstTextNode && seetheMode ? "NOOOOO!! " : "") + e;
                if(firstTextNode) {
                    firstTextNode = false;
                }
                return seetheMode ? ret.toUpperCase() + "!!" : ret;
            }
        });
    }

    const extractText = (elements) => {
        const ret = [];
        for(const e of elements) {
            if(ret.length === 0) {
                ret.push(e.data || e.innerText);
                continue;
            }

            if(e.tagName === "EM") {
                ret[ret.length - 1] += e.innerText;
            } else if(e.tagName === "A") {
                ret.push(e.innerText);
            } else if(e.tagName === "SPAN") {
                if(e.className === "greenText" || e.className === "orangeText") {
                    ret.push(e.innerText);
                } else {
                    ret[ret.length - 1] += e.innerText;
                }
            } else if(e.data !== undefined) {
                ret[ret.length - 1] += e.data;
            }
        }

        //Identity filter to remove empty entries.
        return ret.flatMap(x => x.split("\n")).map(x => x.trim()).filter(x => x);
    };

    const postText = (id) => {
        const seetheMode = document.getElementById("seetheButton").checked;
        return memeficate(extractText([...document.getElementById(id).querySelector(".divMessage").childNodes]
                                        .filter(n => !(n.className || "").split(" ").includes("quoteLink"))), seetheMode);
    };

    const addWojakifyButtons = () => {
        document.querySelectorAll(".postInfo, .opHead").forEach(postInfo => {
            if(postInfo.querySelector(".wojakify") === null && !postInfo.parentNode.parentNode.classList.contains("quoteTooltip")) {
                const button = document.createElement('button');
                button.style = 'cursor: pointer; margin: 5px';
                button.textContent = 'Wojakify';
                button.classList.add("wojakify");
                //button.href = "#";
                button.onclick = (e) => {
                    e.preventDefault();
                    const id = postInfo.querySelector(".linkQuote").innerText;
                    generateWojak(postText(id)).then((generatedWojak) => {
                        postCommon.addSelectedFile(generatedWojak);
                        qr.showQr(id);
                        if(document.getElementById("autoReply").checked) {
                            document.getElementById("fieldMessage").value = ">>" + id;
                            thread.postReply();
                        }
                    });
                };
                postInfo.insertBefore(button, postInfo.childNodes[0]);
            }
        });
    };

    const getCookie = (name) => {
        return (document.cookie.split("; ").find(cookie => cookie.startsWith(name)) || "").split("=")[1];
    }

    const setCookie = (name, value) => {
        //5184000 = 60*60*24*60
        document.cookie = `${name}=${value}; max-age=5184000; samesite=strict; path=/`;
    }

    const deleteCookie = (name) => {
        document.cookie = `${name}= ; expires=Thu, 01 Jan 1970 00:00:00 GMT`
    }

    const createCheckbox = (id, name, initialState) => {
        initialState = initialState === true;
        const isCheckedCookie = getCookie(id + "Enabled");
        if(isCheckedCookie !== undefined)
            initialState = isCheckedCookie === "true";
        let checkbox = document.createElement("input");
        checkbox.type = "checkbox";
        checkbox.id = id;
        checkbox.name = id;
        checkbox.checked = initialState;
        checkbox.onclick = function() {
            setCookie(this.id + "Enabled", this.checked);
        };
        let label = document.createElement("label");
        label.for = id;
        label.innerHTML = name;
        label.onclick = () => document.getElementById(id).click();
        //Make label unselectable;
        label.style = `-webkit-touch-callout: none;
-webkit-user-select: none;
-khtml-user-select: none;
-moz-user-select: none;
-ms-user-select: none;
user-select: none;`;
        return [label, checkbox];
    }

    const createSelect = (id, opts) => {
        let selector = document.createElement("select");
        selector.id = id;
        selector.style.marginLeft = "10px";
        selector.style.marginRight = "5px";
        selector.style.fontSize = "100%";
        for(const key of Object.keys(opts)) {
            let option = document.createElement("option");
            option.textContent = key;
            option.value = key;
            selector.appendChild(option);
        }
        selector.oninput = function() {
            setCookie(this.id + "Value", this.value);
        }

        const previousSelection = getCookie(id + "Value");
        if(previousSelection !== undefined) {
            if(opts[previousSelection] === undefined) {
                deleteCookie(id + "Value");
            } else {
                selector.value = previousSelection;
            }
        }

        return selector;
    }

    let wojakSelector = createSelect("soyjakSelector", options);
    const header = document.getElementById("threadHeader");
    const navOptions = document.getElementById("navOptionsSpan");
    [wojakSelector, ...createCheckbox("seetheButton", "Seethe Mode"), ...createCheckbox("autoReply", "Auto Reply")].forEach(e => header.insertBefore(e, navOptions));

    addWojakifyButtons();
    setInterval(addWojakifyButtons, 5000);
})();
